package scaler.arrays.carryforward;

import java.util.HashSet;
import java.util.Set;

public class HWQ1AmazingSubarrays {
    //  You are given a string S, and you have to find all the amazing substrings of S.
    //  An amazing Substring is one that starts with a vowel (a, e, i, o, u, A, E, I, O, U).
    //  Input
    //  Only argument given is string S.
    //  Output
    //  Return a single integer X mod 10003, here X is the number of Amazing Substrings in given the
    // string.
    //  Constraints
    // 1 <= length(S) <= 1e6
    //  S can have special characters
    //      Example
    //  Input
    //      ABEC
    //  Output
    //    6
    //  Explanation
    //  Amazing substrings of given string are :
    //    1. A
    //    2. AB
    //    3. ABE
    //    4. ABEC
    //    5. E
    //    6. EC
    //  here number of substrings are 6 and 6 % 10003 = 6.
    public int solve(String A) {
        Set<Character> vowels = new HashSet();
        vowels.add('a');
        vowels.add('e');
        vowels.add('i');
        vowels.add('o');
        vowels.add('u');
        vowels.add('A');
        vowels.add('E');
        vowels.add('I');
        vowels.add('O');
        vowels.add('U');
        int count = 0;
        int vowel = 0;
        for (int i = 0; i < A.length(); i++) {
            if (vowels.contains(A.charAt(i))) {
                count = count + (A.length() - i);
            }
//            if (i>=1 && A.charAt(i) == A.charAt(i-1))
//              count = count + vowel;
//            else
//              count = count + 1;

        }
        return count % 10003;
    }

    public static void main(String[] args) {
      System.out.println(new HWQ1AmazingSubarrays().solve("ABEC"));
      System.out.println(new HWQ1AmazingSubarrays().solve(""));
//      
    }
}
